"use strict";angular.module("hillromvestApp").factory("patientsurveyService",["$http","headerService","URL",function(e,r,t){return{isSurvey:function(u){var n=t.isSurvey.replace("USER_ID",u);return e.get(n,{headers:r.getHeader()}).success(function(e){return e})},getSurvey:function(u){var n=t.getSurvey.replace("SURVEY_ID",u);return e.get(n,{headers:r.getHeader()}).success(function(e){return e})},saveSuvey:function(u){var n=t.saveSuvey;return e.post(n,u,{headers:r.getHeader()}).success(function(e){return e})},getSurveyGridReport:function(u,n,c){var s=t.getSurveyGridReport.replace("SURVEY_ID",u).replace("FROM_DATE",n).replace("TO_DATE",c);return e.get(s,{headers:r.getHeader()}).success(function(e){return e})}}}]);